import React from "react";
import { Box, Typography } from "@mui/material";

const SpellOrder: React.FC = () => {
  let name = "toto";
  const baseURL = "https://raw.communitydragon.org/latest/plugins/rcp-be-lol-game-data/global/default/assets/characters/"+name+"/hud/icons2d/"+name; 
  return (
    <Box> 
    <Box
      component={"img"}
      src={baseURL+"p.png"}
    />
    <Box
      component={"img"}
      src={baseURL+"q.png"}
    />
    <Box
      component={"img"}
      src={baseURL+"w.png"}
    />
    <Box
      component={"img"}
      src={baseURL+"e.png"}
    />
    <Box
      component={"img"}
      src={baseURL+"r.png"}
    />
    </Box>
  );
};

export default SpellOrder;
